import{_ as a,a as e,b as t,c as s,d as r,e as o,f as i,g as p,h as c}from"./chunks/nav-rate-en.CDsfTR3z.js";import{_ as l,c as n,o as _,ab as h}from"./chunks/framework.CUflZczI.js";const q=JSON.parse('{"title":"CUAV C-RTK 9Ps","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_cuav_c-rtk-9ps.md","filePath":"uk/gps_compass/rtk_gps_cuav_c-rtk-9ps.md"}'),d={name:"uk/gps_compass/rtk_gps_cuav_c-rtk-9ps.md"},m=h('<h1 id="cuav-c-rtk-9ps" tabindex="-1">CUAV C-RTK 9Ps <a class="header-anchor" href="#cuav-c-rtk-9ps" aria-label="Permalink to &quot;CUAV C-RTK 9Ps&quot;">​</a></h1><p>CUAV <a href="https://www.cuav.net/en/c_rtk_9ps/" target="_blank" rel="noreferrer">C-RTK 9Ps</a> - це багатосупутникова, багатодіапазонна, сантиметрового рівня RTK GNSS система.</p><p>Модуль одночасно приймає сигнали супутників GPS, ГЛОНАСС, Galileo та Beidou, що забезпечує швидке позиціонування та вищу точність. Також підтримує <a href="./../gps_compass/u-blox_f9p_heading.html">RTK GPS Heading</a> за допомогою подвійних модулів.</p><p>Використання C-RTK 9Ps надає PX4 точність позиціювання на рівні сантиметрів. Це ідеальний варіант для дронів для зйомки, сільськогосподарських дронів та інших сценаріїв застосування.</p><p><img src="'+a+'" alt="C-RTK 9Ps"></p><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/c-rtk-9ps/" target="_blank" rel="noreferrer">магазин cuav</a></p><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><p><img src="'+e+'" alt="Specification"></p><h2 id="проводка-та-з-єднання" tabindex="-1">Проводка та з&#39;єднання <a class="header-anchor" href="#проводка-та-з-єднання" aria-label="Permalink to &quot;Проводка та з&#39;єднання&quot;">​</a></h2><p><strong>C-RTK 9Ps (База)</strong></p><p><img src="'+t+'" alt="Base module setup"></p><ul><li>Використовуйте штатив, щоб закріпити антену базової станції зверху, і підключіть антену до базової станції</li><li>Підключіть базову станцію та телеметрію до комп&#39;ютера за допомогою USB-кабелю.</li></ul><p><strong>C-RTK 9Ps (Rover)</strong></p><p><img src="'+s+'" alt="Rover mode setup"></p><ul><li>Встановіть антену C-RTK 9Ps (Rover) вертикально.</li><li>Підключіть антену до C-RTK 9Ps (Rover).</li><li>Підключіть C-RTK 9Ps (Rover) до контролера польоту.</li><li>Підключіть телеметрію до інтерфейсу керування польотом <code>TELEM1</code>/<code>TELEM2</code></li></ul><div class="info custom-block"><p class="custom-block-title">C-RTK 9P поставляються з 6-контактними і 10-контактними роз&#39;ємами, сумісними з польотними контролерами стандарту Pixhawk. Підключіться до <code>GPS1</code> або <code>GPS2</code>. Виберіть відповідний кабель для контролера польоту.</p></div><h2 id="конфігурація" tabindex="-1">Конфігурація <a class="header-anchor" href="#конфігурація" aria-label="Permalink to &quot;Конфігурація&quot;">​</a></h2><p>Налаштування та використання RTK на PX4 за допомогою <em>QGroundControl</em> відбувається за принципом &quot;підключи і працюй&quot; (див. <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> для отримання додаткової інформації).</p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p><img src="'+r+'" alt="Pinouts"></p><h2 id="фізичні-розміри" tabindex="-1">Фізичні розміри <a class="header-anchor" href="#фізичні-розміри" aria-label="Permalink to &quot;Фізичні розміри&quot;">​</a></h2><p><img src="'+o+'" alt="Cuav-9ps dimensions"></p><p><img src="'+i+'" alt="Base unit antenna: physical dimensions"></p><p><img src="'+p+'" alt="Sky unit antenna: physical dimensions"></p><h2 id="частота-оновлення-навігаціі" tabindex="-1">Частота оновлення навігації <a class="header-anchor" href="#частота-оновлення-навігаціі" aria-label="Permalink to &quot;Частота оновлення навігації&quot;">​</a></h2><p><img src="'+c+'" alt="Navigation update rate information"></p><h2 id="докладніше" tabindex="-1">Докладніше <a class="header-anchor" href="#докладніше" aria-label="Permalink to &quot;Докладніше&quot;">​</a></h2><p><a href="https://doc.cuav.net/gps/c-rtk-series/en/c-rtk-9ps/" target="_blank" rel="noreferrer">Документація CUAV</a></p>',29),u=[m];function k(P,g,f,b,T,R){return _(),n("div",null,u)}const K=l(d,[["render",k]]);export{q as __pageData,K as default};
